import React, { Component } from 'react';
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';
import AppBar from 'material-ui/AppBar';
import RaisedButton from 'material-ui/RaisedButton';
import TextField from 'material-ui/TextField';

class Sign_Up_Page extends Component {
  render() {
    return (
      <div>
        <MuiThemeProvider>
          <div>
            <AppBar title="Sign-Up Page" />
            <TextField hintText="Enter your Email" type="email" floatingLabelText="Email" />
            <br />
            <TextField type="password" hintText="Enter your Password" floatingLabelText="Password" />
            <br />
            <RaisedButton label="Log-in" primary={true} style={style} />
          </div>
        </MuiThemeProvider>
      </div>
    );
  }
}
const style = {
  margin: 15,
};
export default Sign_Up_Page;
